	public String getDecryptKey(String encryptedKey) throws Exception {
		// mnrlKeyStore();
		KeyStore keyStore = loadKeyStore(new File(MnrlLoadData.propdetails.getAppProperty().getKeystoreFilePath()),
				mnrlService.decodePassword(MnrlLoadData.propdetails.getAppProperty().getKeystoreSecureTerm()),
				MnrlLoadData.propdetails.getAppProperty().getKeystoreType());
		System.out.println("KeyStore Loaded Successfully");
		PrivateKey privateKey = (PrivateKey) keyStore.getKey(
				mnrlService.decodePassword(MnrlLoadData.propdetails.getAppProperty().getKeystoreAlias()),
				mnrlService.decodePassword(MnrlLoadData.propdetails.getAppProperty().getKeystoreSecureTerm())
						.toCharArray());
		LOGGER.info("Decrypted Key [{}]", decrypt(encryptedKey, privateKey));
		return decrypt(encryptedKey, privateKey);
	}

	public String decrypt(String cipherText, PrivateKey privateKey) throws Exception {
		Cipher cipher = Cipher.getInstance("RSA");
		cipher.init(Cipher.DECRYPT_MODE, privateKey);
		byte[] decrypted = cipher.doFinal(Base64.getDecoder().decode(cipherText));
		return Base64.getEncoder().encodeToString(decrypted);
	}

	public KeyStore mnrlKeyStore(String pvtKeyPath) throws Exception {
		KeyStore keyStore = KeyStore.getInstance(KeyStore.getDefaultType());
		InputStream is = ClassLoader.getSystemResourceAsStream(pvtKeyPath);
		if (is == null) {
			LOGGER.error("keystore file doesnot exist");
			return null;
		}
		keyStore.load(is, mnrlService.decodePassword(MnrlLoadData.propdetails.getAppProperty().getKeystoreSecureTerm())
				.toCharArray());
		return keyStore;
	}

	public static KeyStore loadKeyStore(final File keystoreFile, final String password, final String keyStoreType)
			throws KeyStoreException, IOException, NoSuchAlgorithmException, CertificateException {
		if (null == keystoreFile) {
			throw new IllegalArgumentException("Keystore url may not be null");
		}
		System.out.println("Initializing key store: {}" + keystoreFile.getAbsolutePath());
		final URI keystoreUri = keystoreFile.toURI();
		final URL keystoreUrl = keystoreUri.toURL();
		final KeyStore keystore = KeyStore.getInstance(keyStoreType);
		InputStream is = null;
		try {
			is = keystoreUrl.openStream();
			keystore.load(is, null == password ? null : password.toCharArray());
			System.out.println("Loaded key store");
		} finally {
			if (null != is) {
				is.close();
			}
		}
		return keystore;
	}

	public  String decrypt(String secret, String encryptedString) throws Exception {
		/*
		 * Key secretKey = new SecretKeySpec(Base64.getDecoder().decode(key),
		 * ALGORITHM); Cipher cipher = Cipher.getInstance(TRANSFORMATION);
		 * cipher.init(Cipher.DECRYPT_MODE, secretKey);
		 * 
		 * byte[] decryptedBytes = cipher.doFinal(cipherText); return new
		 * String(decryptedBytes, StandardCharsets.UTF_8);
		 */

		byte[] decodedKey = Base64.getDecoder().decode(secret);
		try {
			Cipher cipher = Cipher.getInstance("AES");
			// rebuild key using SecretKeySpec
			SecretKey originalKey = new SecretKeySpec(Arrays.copyOf(decodedKey, 16), "AES");
			cipher.init(Cipher.DECRYPT_MODE, originalKey);
			byte[] cipherText = cipher.doFinal(Base64.getDecoder().decode(encryptedString));
			return new String(cipherText);
		} catch (Exception e) {
			throw new RuntimeException("Error occured while decrypting data", e);
		}
	}

	public MnrlAtrEncrypt_Vo encRequestData(String Key, String reqData, String pubKey, String token) {
		byte[] cipherData = null;
		byte[] decodedKey = Base64.getDecoder().decode(Key);
		try {
			PublicKey clientPublicKey = getPublicKey(pubKey);
			Cipher cipher = Cipher.getInstance("RSA");
			cipher.init(Cipher.ENCRYPT_MODE, clientPublicKey);
			cipherData = cipher.doFinal(decodedKey);

			String encryptedKey = new String(Base64.getEncoder().encode(cipherData));
			cipher = Cipher.getInstance("AES");
			// rebuild key using SecretKeySpec
			SecretKey originalKey = new SecretKeySpec(Arrays.copyOf(decodedKey, 16), "AES");
			cipher.init(Cipher.ENCRYPT_MODE, originalKey);
			byte[] cipherText = cipher.doFinal(reqData.getBytes());
			String encryptedRequest = new String(Base64.getEncoder().encode(cipherText));

			MnrlAtrEncrypt_Vo atrEncData = new MnrlAtrEncrypt_Vo();

			atrEncData = mnrlAtrService.setMnrlAtrRequest(encryptedKey, encryptedRequest, token);

			return atrEncData;
		} catch (Exception e) {
			LOGGER.error("Exception in encryption ", e);
			e.printStackTrace();
		}
		return null;
	}

	public PublicKey getCertificate(String pubKey) throws CertificateException, IOException {
		CertificateFactory cf = CertificateFactory.getInstance("X.509");
		FileInputStream fin = new FileInputStream(pubKey);
		Certificate ca;
		try {
			ca = cf.generateCertificate(fin);
			System.out.println("Public key : " + ca.getPublicKey());
			return ca.getPublicKey();
		} finally {
			fin.close();
		}
	}

	public static PublicKey getPublicKey(String filePath) throws Exception {
		byte[] keyBytes = Files.readAllBytes(Paths.get(filePath));
		String publicKeyPEM = new String(keyBytes).replace("-----BEGIN PUBLIC KEY-----", "")
				.replace("-----END PUBLIC KEY-----", "").replaceAll("\\s", "");
		byte[] decodedKey = Base64.getDecoder().decode(publicKeyPEM);
		X509EncodedKeySpec keySpec = new X509EncodedKeySpec(decodedKey);
		KeyFactory keyFactory = KeyFactory.getInstance("RSA");
		return keyFactory.generatePublic(keySpec);
	}

